function Propos()
{
    return(
        <div className="relative w-full h-screen transition-all duration-300">

                <div className="absolute top-0 flex items-center justify-center w-full h-20 text-3xl font-bold border-b shadow-md">Header</div>
                <div className="absolute flex items-center justify-center w-full h-full">
                    <div className="w-1/2 bg-red-500 h-1/2">Bobody</div>
                </div>
                <div className="absolute bottom-0 flex items-center justify-center w-full h-20 text-3xl font-bold border-t shadow-md">Footer</div>

        </div>
    );
}
export default Propos;
